import { Component } from "react";
import EventPopup from "./Components/EventPopup";

class EventTile extends Component {
  constructor(props) {
    super(props);

    this.state = {
      formVisible: false
    }
  }

  render() {
    return (
      <div className="event-tile" id={this.props.id} onClick={() => this.props.onClick(this.props.thumbnail, this.props.title, this.props.owner, this.props.creating)}>
        <img src={this.props.thumbnail} alt="" className="event-thumbnail" />
        <h1 className="event-name">{this.props.title}</h1>
        <p className="owner-name">{this.props.owner}</p>
      </div>
    );
  }
}

export default EventTile;
